import OscarData from './data.csv';
import Papa from 'papaparse';
import { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Home() {
  const [chartData, setChartData] = useState({
    datasets: []
  });
  const [chartOptions, setChartOptions] = useState({});
  const [labelCountData, setLabelCountData] = useState(null);
  const [clickedLabel, setClickedLabel] = useState(null);

  useEffect(() => {
    Papa.parse(OscarData, {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: (result) => {
        console.log(result);
        const labelCounts = {};

        result.data.forEach((item) => {
          const label = item['req1Product'];

          if (label) {
            if (labelCounts[label]) {
              labelCounts[label] += 1;
            } else {
              labelCounts[label] = 1;
            }
          }
        });

        setChartData({
          labels: Object.keys(labelCounts),
          datasets: [
            {
              label: "Count",
              data: Object.values(labelCounts),
              borderColor: "black",
              backgroundColor: "red"
            }
          ]
        });

        setChartOptions({
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: "Count of req1Product Values"
            }
          },
          scales: {
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count"
              }
            }
          },
          interaction: {
            intersect: false,
            mode: 'index',
          },
          onHover: (e, elements) => {
            const chart = e.chart;
            const mouseX = e.event.clientX - chart.canvas.getBoundingClientRect().left;
            const labelIndex = findNearestLabelIndex(chart, mouseX);

            if (labelIndex !== null) {
              const label = chart.data.labels[labelIndex];
              chart.canvas.style.cursor = 'pointer';
              chart.options.title.text = `Count of 'prediction' Values for '${label}'`;
            } else {
              chart.canvas.style.cursor = 'default';
              chart.options.title.text = 'Count of req1Product Values';
            }

            chart.update();
          },
          onClick: (e, elements) => {
            const chart = e.chart;
            const mouseX = e.event.clientX - chart.canvas.getBoundingClientRect().left;
            const labelIndex = findNearestLabelIndex(chart, mouseX);

            if (labelIndex !== null) {
              const label = chart.data.labels[labelIndex];
              setClickedLabel(label);
              updateLabelCountData(label);
            } else {
              setClickedLabel(null);
              setLabelCountData(null);
            }
          }
        });
      }
    });
  }, []);

  const findNearestLabelIndex = (chart, mouseX) => {
    const { left, right, labels } = chart.chartArea;
    const labelWidth = (right - left) / labels.length;

    const index = Math.floor((mouseX - left) / labelWidth);

    if (index >= 0 && index < labels.length) {
      return index;
    }

    return null;
  };

  const updateLabelCountData = (label) => {
    Papa.parse(OscarData, {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: (result) => {
        const labelCounts = {};

        result.data.forEach((item) => {
          const labelValue = item['req1Product'];
          const prediction = item['prediction'];

          if (labelValue === label && prediction !== undefined) {
            if (labelCounts[prediction]) {
              labelCounts[prediction] += 1;
            } else {
              labelCounts[prediction] = 1;
            }
          }
        });

        const labelCountChartData = {
          labels: Object.keys(labelCounts),
          datasets: [
            {
              label: "Count",
              data: Object.values(labelCounts),
              borderColor: "black",
              backgroundColor: "green"
            }
          ]
        };

        const labelCountChartOptions = {
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: `Count of 'prediction' Values for '${label}'`
            }
          },
          scales: {
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count"
              }
            }
          }
        };

        setLabelCountData({
          chartData: labelCountChartData,
          chartOptions: labelCountChartOptions
        });
      }
    });
  };

  return (
    <div>
      <h1>HOME PAGE</h1>
      {chartData.datasets.length > 0 ? (
        <div>
          <Bar options={chartOptions} data={chartData} />
          {labelCountData && clickedLabel && (
            <div>
              <h2>Count of 'prediction' Values for '{clickedLabel}'</h2>
              <Bar options={labelCountData.chartOptions} data={labelCountData.chartData} />
            </div>
          )}
        </div>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
}

export default Home;
